            if(res.ok) {
                updateUser(null)
                history.push('/authentication')
            }
        })
    }

    return (

        <Container>
        <nav className = 'navigation'>
            <NavLink className='brand-name' exact to='/' > 
            <Typography> Topher Emby </Typography>
                {/* <strong> Topher Emby </strong> */}
             </NavLink>

            <List>
                <Button onClick={handleLogout}>  Logout  </Button>
